import cardImg from './image.jpg'
import React, { useState } from "react";
function App() {
  const [count, setCount] = useState(0);

  const incrementCount = () => {
    setCount(count + 1);
  };
  return (
    <div className="App">
        <div onClick={incrementCount}>
          <img src={cardImg}/>
        </div>
    </div>
  );
}

export default App;
